public class AdParseWrapper extends AdParser {
    private StringBuilder AD_MOBILE_WEB = new StringBuilder();


    public AdParseWrapper(String adResponse, int sdkVersion) {
        super(adResponse, sdkVersion);
    }

    public String parseAd() {
        return super.getAd();
    }

    public String getJsAd() {
        this.AD_MOBILE_WEB = HtmlTemplates.MobileWebAdBuilder(super.getAd());
        return this.AD_MOBILE_WEB.toString();
    }


    public static void main(String[] args) {
        String adResp = "HTTP/1.1 200 OK\n" +
                "Date: Sat, 02 Mar 2013 05:33:28 GMT\n" +
                "Expires: -1\n" +
                "Cache-Control: no-cache,no-store,must-revalidate\n" +
                "Pragma: no-cache\n" +
                "Content-Type: application/octet-stream\n" +
                "Content-Length: 36012\n" +
                "\n" +
                "\n";

        AdParseWrapper adParseWrapper = new AdParseWrapper(adResp, 510);
        System.out.println(adParseWrapper.getAd());                   // Testing - getAd();
        //System.out.println(adParseWrapper.getJsAd());          // Testing js ad
        //System.out.println(adParseWrapper.getDecryptedAd());     // testing decrypted ad
    }
}
